import React, { Component } from 'react';
import { Link } from "react-router-dom";

function Nav() {
  return (  
  <>
  <nav id='nav'>
      <Link to="/">Home</Link>
  <span> | </span>
      <Link to="/Login">Login</Link>
  <span> | </span>
      <Link to="/Register">Register</Link>
  <span> | </span>
      <Link to="/Add">Add</Link>
  <span> | </span>
      <Link to="/Update">Update</Link>
    </nav> 
  </>
  );
}

export default Nav;
